func New(width, height uint, url string) Model {
	return Model{
		width:  width,
		height: height,
		url:    url,
	}
}

method_Init_29.content:
func (m Model) Init() tea.Cmd {
	return nil
}

method_Update_33.content:
func (m Model) Update(msg tea.Msg) (Model, tea.Cmd) {
	switch msg := msg.(type) {
	case errMsg:
		m.err = msg
		return m, nil
	case redrawMsg:
		m.width = msg.width
		m.height = msg.height
		m.url = msg.url
		return m, loadURL(m.url)
	case loadMsg:
		return handleLoadMsg(m, msg)
	}
	return m, nil
}

method_View_49.content:
func (m Model) View() string {
	if m.err != nil {
		return fmt.Sprintf("couldn't load image(s): %v", m.err)
	}
	return m.image
}

method_Redraw_58.content:
func (m Model) Redraw(width uint, height uint, url string) tea.Cmd {
	return func() tea.Msg {
		return redrawMsg{
			width:  width,
			height: height,
			url:    url,
		}
	}
}

method_UpdateURL_68.content:
func (m Model) UpdateURL(url string) tea.Cmd {
	return func() tea.Msg {
		return redrawMsg{
			width:  m.width,
			height: m.height,
			url:    url,
		}
	}
}

struct_redrawMsg_78.content:
type redrawMsg struct {
	width  uint
	height uint
	url    string
}

method_IsLoading_84.content:
func (m Model) IsLoading() bool {
	return m.image == ""
}
